title: "台灣人海外旅遊分析"
description: "根據交通部觀光局統計資料，以國人出境數據係以飛航到達首站為統計原則，統計其間為 202201-202411。"
date: "2025-01-17"
html:
  toc: true  # 目錄
---


- **報告背景**：  
  本報告分析了台灣旅客至海外各目的地的旅遊數據，涵蓋性別、年齡層及時間（按年月）等資訊，旨在挖掘旅遊趨勢、熱門目的地及潛在的市場機會。

- **數據來源**：  

::: {#387002c5 .cell execution_count=1}

::: {.cell-output .cell-output-display execution_count=1}
```{=html}
  本數據來交通部觀光局的統計，包含 15,190 筆數據，涵蓋年份、月份、目的地、年齡群體與性別分佈。
```
:::
:::


- **報告目標**：
  - 確定旅遊目的地的趨勢與季節性。
  - 分析年齡層與性別的偏好。
  - 識別熱門目的地與潛在市場。

